import { useState } from "react";
import { data } from "./data";


function App() {
  const[name,setName]=useState("")
  return (
    <>
    <input type="text"  value={name} onChange={(e)=>setName(e.target.value)}/>
    <div>
      {
        data.map((e,i)=>{
          return <div key={i}>
              <h4>{e.name}</h4>
          </div>
        })
      }
    </div>
    </>
  );
}

export default App;
